import React from 'react';
import { Link } from 'react-router-dom';

const EventifyDetails = () => {
  const styles = {
    pageContainer: {
      marginTop: '64px',
      minHeight: '100vh'
    },
    heroSection: {
      background: 'linear-gradient(135deg, #6366f1 0%, #8b5cf6 50%, #7c3aed 100%)',
      padding: '120px 0 80px',
      color: 'white',
      position: 'relative',
      overflow: 'hidden'
    },
    heroPattern: {
      position: 'absolute',
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundImage: `radial-gradient(circle at 25% 25%, rgba(255, 255, 255, 0.1) 0%, transparent 50%),
                        radial-gradient(circle at 75% 75%, rgba(255, 255, 255, 0.1) 0%, transparent 50%)`,
      pointerEvents: 'none'
    },
    container: {
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '0 24px',
      position: 'relative',
      zIndex: 1
    },
    breadcrumb: {
      fontSize: '0.875rem',
      marginBottom: '24px',
      opacity: 0.9
    },
    breadcrumbLink: {
      color: 'rgba(255, 255, 255, 0.8)',
      textDecoration: 'none',
      transition: 'color 0.2s ease'
    },
    projectBadge: {
      background: 'rgba(255, 255, 255, 0.2)',
      color: 'white',
      padding: '8px 16px',
      borderRadius: '20px',
      fontSize: '0.875rem',
      fontWeight: '600',
      textTransform: 'uppercase',
      letterSpacing: '0.05em',
      display: 'inline-block',
      marginBottom: '24px',
      border: '1px solid rgba(255, 255, 255, 0.3)'
    },
    heroTitle: {
      fontSize: window.innerWidth <= 768 ? '3rem' : '4.5rem',
      fontWeight: '800',
      marginBottom: '24px',
      lineHeight: '1.1'
    },
    heroSubtitle: {
      fontSize: '1.375rem',
      lineHeight: '1.6',
      maxWidth: '800px',
      opacity: 0.95,
